import React from "react";
import AppHome from "./AppHome";
import AppService from "./AppService";
import AppContact from "./AppContact";
import AppAbout from "./AppAbout";
import AppMenu from "./AppMenu";


const App = () => {
    return (
        <>
        <Switch>
            <Route to = "/" component = {AppHome}></Route>
            <Route to = "/service" component = {AppService}></Route>
            <Route to = "/contact" component = {AppContact}></Route>
            <Route to = "/about" component = {AppAbout}></Route>
            <Route to = "/menu" component = {AppMenu}></Route>
        </Switch>
        
        </>
    );
}

export default App;
